import React, { Component } from 'react';

class Score extends Component {
  constructor(props) {
    super(props);
  }
  render() {
    let snake = this.props.snake;
    return (
      <div className="score">
        <span>
          Score: <strong>{this.props.score}</strong>
        </span>
        <span>
          High Score: <strong>{this.props.high_score}</strong>
        </span>
      </div>
    );
  }
}

export default Score;
